apiVersion: apps.kubermatic.k8c.io/v1
kind: ApplicationDefinition
metadata:
  name: kueue
spec:
  description: A Kubernetes-native job queueing system for managing batch, AI/ML, and HPC workloads
  displayName: Kueue
  method: helm
  versions:
    - template:
        source:
          helm:
            chartName: kueue
            chartVersion: 0.13.4
            url: oci://quay.io/kubermatic-mirror/helm-charts
      version: v0.13.4
  defaultValuesBlock: |
    nameOverride: "kueue"
    fullnameOverride: "kueue"
  documentationURL: https://kueue.sigs.k8s.io
  sourceURL: https://github.com/kubernetes-sigs/kueue
  logo: |-
    
  logoFormat: svg+xml
